import { createTheme } from '@mui/material/styles';

export const theme = createTheme({
    palette: {
        primary: {
            main: '#E95050'
        },
        sucess: {
            main: '#15A89E'
        },
        text: {
            primary: '#050207',
            secondary: '#444444',
            disable: '#D4D4D4',
        },
        background: {
            lightGrey: '#ECECEC',
            midGrey: '#D4D4D4',
            darkGrey: '#444444'
        }
    },
    typography: {
        h1: {
            fontWeight: 700,
            fontSize: '3rem',
            text
        }
    }
});
